import React, { Suspense } from 'react';
import { Canvas } from '@react-three/fiber';
import { Environment, OrbitControls, useGLTF, Plane, Stars } from '@react-three/drei';

function Tree({ position }) {
  return (
    <group position={position}>
      {/* Tree trunk */}
      <mesh castShadow position={[0, 1, 0]}>
        <cylinderGeometry args={[0.2, 0.3, 2, 8]} />
        <meshStandardMaterial color="#5d4037" />
      </mesh>
      {/* Tree top */}
      <mesh castShadow position={[0, 2.5, 0]}>
        <coneGeometry args={[1, 3, 8]} />
        <meshStandardMaterial color="#2e7d32" />
      </mesh>
    </group>
  );
}

function CampingScene() {
  return (
    <group>
      {/* Ground */}
      <Plane 
        receiveShadow 
        rotation={[-Math.PI / 2, 0, 0]} 
        position={[0, -0.1, 0]} 
        args={[50, 50]}
      >
        <meshStandardMaterial color="#90a955" />
      </Plane>

      {/* Trees */}
      {[...Array(15)].map((_, i) => {
        const angle = (i / 15) * Math.PI * 2;
        const radius = 12 + Math.random() * 8;
        return (
          <Tree 
            key={i} 
            position={[
              Math.cos(angle) * radius,
              0,
              Math.sin(angle) * radius
            ]} 
          />
        );
      })}

      {/* Campfire */}
      <group position={[3, 0, 3]}>
        {/* Logs */}
        {[...Array(3)].map((_, i) => (
          <mesh
            key={i}
            position={[
              Math.cos((i / 3) * Math.PI * 2) * 0.3,
              0.1,
              Math.sin((i / 3) * Math.PI * 2) * 0.3
            ]}
            rotation={[0, (i / 3) * Math.PI * 2, 0]}
            castShadow
          >
            <cylinderGeometry args={[0.1, 0.1, 1, 6]} />
            <meshStandardMaterial color="#3e2723" />
          </mesh>
        ))}
        {/* Stones around campfire */}
        {[...Array(8)].map((_, i) => (
          <mesh
            key={i}
            position={[
              Math.cos((i / 8) * Math.PI * 2) * 0.6 + 3,
              0,
              Math.sin((i / 8) * Math.PI * 2) * 0.6 + 3
            ]}
            castShadow
          >
            <sphereGeometry args={[0.15, 8, 8]} />
            <meshStandardMaterial color="#757575" />
          </mesh>
        ))}
      </group>
    </group>
  );
}

function Model() {
  const { scene } = useGLTF('/models/zomepod.glb');

  return (
    <primitive 
      object={scene} 
      scale={1} 
      position={[0, 0, 0]}
      castShadow
      receiveShadow
    />
  );
}

const ModelViewer = () => {
  return (
    <div style={{ width: '100vw', height: '100vh', background: '#87CEEB' }}>
      <Canvas 
        camera={{ position: [15, 8, 15], fov: 45 }}
        shadows
      >
        {/* Sky and ambient lighting */}
        <color attach="background" args={['#87CEEB']} />
        <ambientLight intensity={0.5} />
        <directionalLight
          position={[10, 15, 10]}
          intensity={1}
          castShadow
          shadow-mapSize-width={2048}
          shadow-mapSize-height={2048}
          shadow-camera-far={50}
          shadow-camera-left={-20}
          shadow-camera-right={20}
          shadow-camera-top={20}
          shadow-camera-bottom={-20}
        />

        {/* Scene content */}
        <Suspense fallback={null}>
          <Model />
          <CampingScene />
          <Environment preset="sunset" background blur={0.8} />
          <Stars radius={100} depth={50} count={5000} factor={4} fade />
        </Suspense>

        {/* Controls */}
        <OrbitControls 
          enablePan={true}
          enableZoom={true}
          enableRotate={true}
          minDistance={5}
          maxDistance={30}
          maxPolarAngle={Math.PI / 2.1} // Prevent camera from going below ground
        />
      </Canvas>
    </div>
  );
};

// Pre-load the model
useGLTF.preload('/models/zomepod.glb');

export default ModelViewer;
